ego ha sido específicamente concebida para superar sus más altas expectativas dándole a Usted un mayor poder de compra y la máxima flexibilidad para efectuar sus pagos. </p>\n<p>¿Por qué solicitar una tarjeta de crédito VISA Clásica de CoopMego?</p>\n<p>* Aceptada en más de 25 millones de establecimientos afiliados<br />\n* Acceso a 750.000 cajeros automáticos en la RED PLUS<br />\n* Realiza avances de efectivo cuando y donde tú lo necesites<br />\n* Difiere tus consumos nacionales e internacionales en produbanco.com<br />\n* Personaliza tu cupo para compras en el país, exterior e internet a través de produbanco.com<br />\n* Regístrate en <a href=\"http://www.produbox.com\">www.produbox.com</a>, realiza tus compras en Estados Unidos y recíbelas en Ecuador<br />\n* Escoge la fecha de corte de tu estado de cuenta, puede ser el 15 ó el 30 de cada mes<br />\n* Realiza el pago total o mínimo (crédito rotativo)</p>\n<p>Consulta sobre seguro de viajes, reposición urgente de tarjeta y servicio de efectivo de emergencia en el Centro de Asistencia VISA, <a href=\"http://www.lac.visa.com\">www.lac.visa.com</a></p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:18:\"field_imagenpagina\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:1:\"9\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:9:\"visa.jpeg\";s:3:\"uri\";s:20:\"public://visa_0.jpeg\";s:8:\"filemime\";s:10:\"image/jpeg\";s:8:\"filesize\";s:5:\"13246\";s:6:\"status\";s:1:\"1\";s:9:\"timestamp\";s:10:\"1521299038\";s:11:\"rdf_mapping\";a:0:{}s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:3:\"283\";s:6:\"height\";s:3:\"178\";}}}}',0,1521331477,1),('field:node:13','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:909:\"<p>Tarjeta Mastercard CoopMego te permitirá comprar en más de 28 millones de comercios afiliados a MasterCard en Ecuador y el mundo, la compra se debitará del saldo disponible de la cuenta corriente/ahorros pagando solamente lo que consume, sin recargos adicionales. Además con tu tarjeta PacifiCard puedes realizar en los cajeros de la CoopMego las siguientes transacciones:</p>\r\n\r\n<ul>\r\n	<li>Pago de tarjetas (MasterCard y Visa).</li>\r\n	<li>Compra de Pines y tiempo Aire para Celular (Claro, Movistar y CNT).</li>\r\n	<li>Pago de servicios básicos (Agua, luz y teléfono).</li>\r\n	<li>Pago de impuestos prediales.</li>\r\n	<li>Pago de matriculación vehicular y transferencia de dominio.</li>\r\n	<li>Pago de centros educativos y televisión pagada.</li>\r\n	<li>Retiros de Efectivo.</li>\r\n	<li>Consulta de saldos de cuenta corriente o de ahorros.</li>\r\n	<li>Transferencias entre cuentas del Banco</li>\r\n</ul>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:884:\"<p>Tarjeta Mastercard CoopMego te permitirá comprar en más de 28 millones de comercios afiliados a MasterCard en Ecuador y el mundo, la compra se debitará del saldo disponible de la cuenta corriente/ahorros pagando solamente lo que consume, sin recargos adicionales. Además con tu tarjeta PacifiCard puedes realizar en los cajeros de la CoopMego las siguientes transacciones:</p>\n<ul><li>Pago de tarjetas (MasterCard y Visa).</li>\n<li>Compra de Pines y tiempo Aire para Celular (Claro, Movistar y CNT).</li>\n<li>Pago de servicios básicos (Agua, luz y teléfono).</li>\n<li>Pago de impuestos prediales.</li>\n<li>Pago de matriculación vehicular y transferencia de dominio.</li>\n<li>Pago de centros educativos y televisión pagada.</li>\n<li>Retiros de Efectivo.</li>\n<li>Consulta de saldos de cuenta corriente o de ahorros.</li>\n<li>Transferencias entre cuentas del Banco</li>\n</ul>\";s:12:\"safe_summary\";s:0:\"\";}}}s:18:\"field_imagenpagina\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:2:\"10\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:14:\"MasterCard.png\";s:3:\"uri\";s:23:\"public://MasterCard.png\";s:8:\"filemime\";s:9:\"image/png\";s:8:\"filesize\";s:5:\"56302\";s:6:\"status\";s:1:\"1\";s:9:\"timestamp\";s:10:\"1521300800\";s:11:\"rdf_mapping\";a:0:{}s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:3:\"288\";s:6:\"height\";s:3:\"208\";}}}}',0,1521332769,1),('field:node:14','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:561:\"La Superintendencia de Compañías es el organismo técnico, con autonomía administrativa y económica, que vigila y controla la organización, actividades, funcionamiento, disolución y liquidación de las compañías y otras entidades en las circunstancias y condiciones establecidas por la Ley.\r\n\r\nLa Superitendencia de Compañías controla, vigila y promueve el mercado de valores, el sector societario y de seguros, mediante sistemas de regulación y servicios, contribuyendo al desarrollo confiable y transparente de la actividad empresarial en el país.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:573:\"<p>La Superintendencia de Compañías es el organismo técnico, con autonomía administrativa y económica, que vigila y controla la organización, actividades, funcionamiento, disolución y liquidación de las compañías y otras entidades en las circunstancias y condiciones establecidas por la Ley.</p>\n<p>La Superitendencia de Compañías controla, vigila y promueve el mercado de valores, el sector societario y de seguros, mediante sistemas de regulación y servicios, contribuyendo al desarrollo confiable y transparente de la actividad empresarial en el país.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:18:\"field_imagenpagina\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:2:\"11\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:18:\"supercompanias.png\";s:3:\"uri\";s:27:\"public://supercompanias.png\";s:8:\"filemime\";s:9:\"image/png\";s:8:\"filesize\";s:5:\"24314\";s:6:\"status\";s:1:\"1\";s:9:\"timestamp\";s:10:\"1521301681\";s:11:\"rdf_mapping\";a:0:{}s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:3:\"320\";s:6:\"height\";s:3:\"108\";}}}}',0,1521331362,1),('field:node:15','a:2:{s:9:\"field_url\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:3:\"