servicio.</h3>\r\n\r\n<h3>Mediante el Servicio de Transacciones Electrónicas MegOnline, usted puede realizar el pago de valores por concepto de:</h3>\r\n\r\n<ul>\r\n	<li>\r\n	<h3>Telefonía fija</h3>\r\n	</li>\r\n</ul>\r\n\r\n<h3>Solicite de forma gratuita la activación del Servicio MegOnline en una de nuestras Oficinas o si cuenta con el servicio ingrese a la página de la institución.</h3>\r\n\r\n<h3>&nbsp;</h3>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:997:\"<p><strong>¿Cómo realizar el pago?</strong></p>\n<p>Mediante débito de su cuenta de ahorros CoopMego, usted puede realizar el pago de valores por concepto de:</p>\n<ul><li>\n	Telefonía fija y móvil\n	</li>\n<li>\n	TV prepagada\n	</li>\n<li>\n	Internet\n	</li>\n</ul><p>Es importante que usted registre su cuenta de ahorros en las Oficinas de la CNT o en las Oficinas de CoopMego.</p>\n<p>Mediante el pago en efectivo en nuestra Oficinas, usted puede cancelar valores de los siguientes servicios:</p>\n<ul><li>\n	Telefonía fija y móvil\n	</li>\n<li>\n	TV prepagada\n	</li>\n<li>\n	Internet\n	</li>\n</ul><p>Es importante que usted presente el número del servicio.</p>\n<p>Mediante el Servicio de Transacciones Electrónicas MegOnline, usted puede realizar el pago de valores por concepto de:</p>\n<ul><li>\n	Telefonía fija\n	</li>\n</ul><p>Solicite de forma gratuita la activación del Servicio MegOnline en una de nuestras Oficinas o si cuenta con el servicio ingrese a la página de la institución.</p>\n<p> </p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:12:\"field_imagen\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:2:\"23\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:14:\"pagoOnline.jpg\";s:3:\"uri\";s:23:\"public://pagoOnline.jpg\";s:8:\"filemime\";s:10:\"image/jpeg\";s:8:\"filesize\";s:4:\"9205\";s:6:\"status\";s:1:\"1\";s:9:\"timestamp\";s:10:\"1521331164\";s:11:\"rdf_mapping\";a:0:{}s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:3:\"320\";s:6:\"height\";s:3:\"212\";}}}s:17:\"field_descripcion\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:141:\"Ahora la CoopMego te permite realizar el pago directo de tus facturas de telefonía e Internet, a través de nuestras oficinas y vía online.\";s:6:\"format\";N;s:10:\"safe_value\";s:141:\"Ahora la CoopMego te permite realizar el pago directo de tus facturas de telefonía e Internet, a través de nuestras oficinas y vía online.\";}}}}',0,1521331580,1),('field:node:7','a:3:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:1487:\"<h4>En todas las ventanillas de CoopMego usted puede realizar &nbsp;el pago de valores del Servicio de Rentas Internas (SRI):</h4>\r\n\r\n<ul>\r\n	<li>\r\n	<h4><em>IVA</em></h4>\r\n	</li>\r\n	<li>\r\n	<h4><em>RISE</em></h4>\r\n	</li>\r\n	<li>\r\n	<h4><em>Impuestos Fiscales (Otras Formas de Pago).</em></h4>\r\n	</li>\r\n	<li>\r\n	<h4><em>Matriculación Vehicular, Transferencia de Dominio y Ajustes.</em></h4>\r\n	</li>\r\n	<li>\r\n	<h4><em>Otros.</em></h4>\r\n	</li>\r\n</ul>\r\n\r\n<h4><strong>¿Cómo realizar el pago?</strong></h4>\r\n\r\n<h4><strong>Mediante débito de su cuenta de ahorros CoopMego</strong></h4>\r\n\r\n<ul>\r\n	<li>\r\n	<h4>Ingrese a la página web del SRI con su número de identificación y clave.</h4>\r\n	</li>\r\n	<li>\r\n	<h4>Acceda al menú “General” / “Declaraciones” / “Registro y/o actualización de cuentas bancarias”.</h4>\r\n	</li>\r\n	<li>\r\n	<h4>En la lista de instituciones financieras búsquenos como Manuel Esteban Godoy Ortega Ltda.</h4>\r\n	</li>\r\n	<li>\r\n	<h4>Registre los datos de su cuenta de ahorros CoopMego.</h4>\r\n	</li>\r\n</ul>\r\n\r\n<p><img alt=\"pago-sri\" class=\"alignnone size-full wp-image-2906\" src=\"https://www.coopmego.com/wp-content/uploads/2017/09/pago-sri.jpg\" /></p>\r\n\r\n<h4><strong>Mediante el pago en efectivo en nuestras Oficinas</strong></h4>\r\n\r\n<ul>\r\n	<li>\r\n	<h4>Presente en las ventanillas de CoopMego el código para el pago: número de RUC, Comprobante Electrónico para Pago (CEP) o número de placa del vehículo, según corresponda.</h4>\r\n	</li>\r\n</ul>\r\n\r\n<h4>&nbsp;</h4>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:1162:\"<p>En todas las ventanillas de CoopMego usted puede realizar  el pago de valores del Servicio de Rentas Internas (SRI):</p>\n<ul><li>\n	<em>IVA</em>\n	</li>\n<li>\n	<em>RISE</em>\n	</li>\n<li>\n	<em>Impuestos Fiscales (Otras Formas de Pago).</em>\n	</li>\n<li>\n	<em>Matriculación Vehicular, Transferencia de Dominio y Ajustes.</em>\n	</li>\n<li>\n	<em>Otros.</em>\n	</li>\n</ul><p><strong>¿Cómo realizar el pago?</strong></p>\n<p><strong>Mediante débito de su cuenta de ahorros CoopMego</strong></p>\n<ul><li>\n	Ingrese a la página web del SRI con su número de identificación y clave.\n	</li>\n<li>\n	Acceda al menú “General” / “Declaraciones” / “Registro y/o actualización de cuentas bancarias”.\n	</li>\n<li>\n	En la lista de instituciones financieras búsquenos como Manuel Esteban Godoy Ortega Ltda.\n	</li>\n<li>\n	Registre los datos de su cuenta de ahorros CoopMego.\n	</li>\n</ul><p><strong>Mediante el pago en efectivo en nuestras Oficinas</strong></p>\n<ul><li>\n	Presente en las ventanillas de CoopMego el código para el pago: número de RUC, Comprobante Electrónico para Pago (CEP) o número de placa del vehículo, según corresponda.\n	</li>\n</ul><p> </p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:12:\"field_imagen\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:2:\"26\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:7:\"sri.jpg\";s:3:\"uri\";s:16:\"public://sri.jpg\";s:8:\"filemime\";s:10:\"image/jpeg\";s:8:\"filesize\";s:5:\"10854\";s:6:\"status\";s:1:\"1\";s:9:\"timestamp\";s:10:\"1521332603\";s:11:\"rdf_mapping\";a:0:{}s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:3:\"320\";s:6:\"height\";s:3:\"201\";}}}s:17:\"field_descripcion\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:106:\"Ahora tu cooperativa te permite pagar directamente los valores e impuestos al Servicio de Rentas Internas.\";s:6:\"format\";N;s:10:\"safe_value\";s:106:\"Ahora tu cooperativa te permite pagar directamente los valores e impuestos al Servicio de Rentas Internas.\";}}}}',0,1521332604,1),('field:node:8','a:3:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:1090:\"<h4>Crédito dirigido a socios emprendedores como usted, lo ayudamos a consolidar o ampliar su negocio o empresa. Financiamos capital de trabajo, adquisición de maquinaria, mobiliario, equipamiento, etc.</h4>\r\n\r\n<hr />\r\n<h4><strong>Beneficios:</strong></h4>\r\n\r\n<ul>\r\n	<li>Plazo hasta 10 años, dependiendo del monto del crédito y garantía.</li>\r\n	<li>Usted elige el día de pago de sus cuotas.</li>\r\n	<li>Cero costo por la cancelación anticipada de créditos.</li>\r\n	<li>Seguro de Desgravamen.</li>\r\n	<li>Seguro de Vida por sus Certificados de Aportación.</li>\r\n</ul>\r\n\r\n<h4><strong>Requisitos:</strong></h4>\r\n\r\n<ul>\r\n	<li>Fotocopia de Cédula de Ciudadanía y Certificado de Votación actualizados.</li>\r\n	<li>Fotocopia del pago de luz, agua o teléfono (de uno de los tres últimos meses).</li>\r\n	<li>Fotocopia del RUC O RISE.</li>\r\n	<li>Fotocopia de las tres últimas declaraciones del IVA o copias de facturas de proveedores de los tres últimos meses.</li>\r\n</ul>\r\n\r\n<h4>Condiciones:</h4>\r\n\r\n<ul>\r\n	<li>Ser propietario de un negocio establecido por lo menos un año.</li>\r\n</ul>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:1026:\"<p>Crédito dirigido a socios emprendedores como usted, lo ayudamos a consolidar o ampliar su negocio o empresa. Financiamos capital de trabajo, adquisición de maquinaria, mobiliario, equipamiento, etc.</p>\n<p><strong>Beneficios:</strong></p>\n<ul><li>Plazo hasta 10 años, dependiendo del monto del crédito y garantía.</li>\n<li>Usted elige el día de pago de sus cuotas.</li>\n<li>Cero costo por la cancelación anticipada de créditos.</li>\n<li>Seguro de Desgravamen.</li>\n<li>Seguro de Vida por sus Certificados de Aportación.</li>\n</ul><p><strong>Requisitos:</strong></p>\n<ul><li>Fotocopia de Cédula de Ciudadanía y Certificado de Votación actualizados.</li>\n<li>Fotocopia del pago de luz, agua o teléfono (de uno de los tres últimos meses).</li>\n<li>Fotocopia del RUC O RISE.</li>\n<li>Fotocopia de las tres últimas declaraciones del IVA o copias de facturas de proveedores de los tres últimos meses.</li>\n</ul><p>Condiciones:</p>\n<ul><li>Ser propietario de un negocio establecido por lo menos un año.</li>\n</ul>\";s:12:\"safe_summary\";s:0:\"\";}}}s:12:\"field_imagen\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:2:\"24\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:11:\"credito.jpg\";s:3:\"uri\";s:20:\"public://credito.jpg\";s:8:\"filemime\";s:10:\"image/jpeg\";s:8:\"filesize\";s:5:\"12595\";s:6:\"status\";s:1:\"1\";s:9:\"timestamp\";s:10:\"1521332100\";s:11:\"rdf_mapping\";a:0:{}s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:3:\"300\";s:6:\"height\";s:3:\"200\";}}}s:17:\"field_descripcion\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:106:\"Para tí, que eres emprendedor, te ofrecemos las tasas de interés más bajas, con los mejores beneficios.\";s:6:\"format\";N;s:10:\"safe_value\";s:106:\"Para tí, que eres emprendedor, te ofrecemos las tasas de interés más bajas, con los mejores beneficios.\";}}}}',0,1521332101,1),('field:user:1','a:0:{}',0,1521331578,1),('field_info:bundle:node:enlacesdeinteres','a:2:{s:9:\"instances\";a:2:{s:9:\"field_url\";a:13:{s:5:\"label\";s:3:\"Url\";s:6:\"widget\";a:5:{s:6:\"weight\";s:2:\"-3\";s:4:\"type\";s:10:\"link_field\";s:6:\"module\";s:4:\"link\";s:6:\"active\";i:0;s:8:\"settings\";a:0:{}}s:8:\"settings\";a:12:{s:12:\"absolute_url\";i:1;s:12:\"validate_url\";i:1;s:3:\"url\";i:0;s:5:\"title\";s:4:\"none\";s:11:\"title_value\";s:0:\"\";s:27:\"title_label_use_field_label\";i:0;s:15:\"title_maxlength\";s:3:\"128\";s:7:\"display\";a:1:{s:10:\"url_cutoff\";s:2:\"80\";}s:10:\"attributes\";a:6:{s:6:\"target\";s:7:\"default\";s:3:\"